import React from "react";
import "../Components/style.css";

const Help = () => {
  return (
    <div className="page-container">
      <h1>Help</h1>
      <p>
        Need assistance? Below are some frequently asked questions to help you get started:
      </p>
      <ul>
        <li><strong>How do I use the design tool?</strong> Follow the step-by-step instructions provided on the homepage.</li>
        <li><strong>How do I sign up?</strong> Click on the Sign Up button in the navbar and fill in your details.</li>
        <li><strong>What if I have a technical issue?</strong> Please check our troubleshooting guide or contact our support team.</li>
      </ul>
    </div>
  );
};

export default Help;
